import React from 'react';
import styled, {css} from 'styled-components';
import {theme} from "../styles/theme";

const TestWrapper = styled.button`
  border: none;
  padding: 10px 20px;
  font-size: 20px;
  cursor: pointer;
  background-color: ${theme => theme.color.footer || '#000000'};
  color: ${theme => theme.color.footer || '#ffffff'};
  
  &:hover {
    scale: 1.1;
  }
`

const Test = () => {
  return <TestWrapper {...theme}/>;
};

export default Test;
